from fastapi import FastAPI
from .main import app, create_upload_file, create_upload_file_with_parameters, displayImage, read_image_data, perturb_image, create_upload_file
from PIL import Image
from fastapi.testclient import TestClient
import requests
from fastapi.responses import FileResponse, Response

client = TestClient(app)


def test_read_root():
    # testing the root of the API
    response = client.get('/')

    assert response.status_code == 200
    assert response.json() == {"message": "Hello World"}


def test_read_image_data():
    # testing the read_image_data function using FastAPI's inbuilt tester
    testunicode = '{"Width":640,"Height":480,"Format":"JPEG"}'
    response = client.get(
        '/imageurl?image_url=https://farm1.staticflickr.com/74/202734059_fcce636dcd_z.jpg')

    assert response.status_code == 200
    assert response.text == testunicode


def test_perturb_url():
    # testing the perturbation with a sliding window using FastAPI's inbuilt tester
    response = client.get(
        "/perturb/sliding_window?image_url=https://farm1.staticflickr.com/74/202734059_fcce636dcd_z.jpg")

    assert response.status_code == 200
    assert response.text == '{"Successfully perturbed":200}'


def test_create_upload_file():
    # testing the perturb method using the requests package
    files = {'file': open('1616031519513.jpg', 'rb')}
    r = requests.post('http://localhost:8000/perturb',
                      files=files)

    assert r.status_code == 200
    assert r.text == '{"filename":"1616031519513.jpg","Pert Masks":[1320,574,462]}'


def test_create_upload_with_parameters():
    # perturbing test image with 20 window size and 10 window stride
    files = {'file': open('1616031519513.jpg', 'rb')}
    r = requests.post(
        'http://localhost:8000/perturbWithParameters?windowSizeDefault40=20&windowStrideDefault15=10', files=files)
    print(r.text)
    assert r.status_code == 200
    assert r.text == '{"filename":"1616031519513.jpg","Pert Masks":[2832,574,462]}'


